var str =
  "";

function vowelsubstring(w: string) {
  console.log(w.length);
  const vowels = { a: "a", e: "e", i: "i", o: "o", u: "u" };

  let count = 0,
    left = 0,
    right = 0;

  while (left < w.length) {
    if (vowels[w[right]]) {
      if (right - left >= 5 && new Set(w.slice(left, right)).size === 5) {
        count++;
      }
      right++;
    } else {
      if (right - left >= 5 && new Set(w.slice(left, right)).size === 5) {
        count++;
      }
      left++;
      right = left;
    }
  }
  return count;
}
vowelsubstring(str);
